    setCartIsShown((prevState) => !prevState);
  };
  const hideCart = () => {};
  return (
    <Fragment>
      {cartIsShown && <Cart />}
      <Header />
      <main>
        <Meals />
      </main>
    </Fragment>
  );
}

export default App;
